import React, { useState, useEffect } from "react";
import s from "./Booking.module.css";
import { Link, NavLink } from "react-router-dom";
import Header from "../Header_Footer/Header";
import pic1 from "./master.png";
import pic2 from "./services.png";
import axios from 'axios';
import EndBooking from "./EndBooking/EndBooking";
import { Route } from "react-router";

export default function Booking() {

    /*const [barber, setBarber] = useState([])
    useEffect(() => {
        axios
            .get("https://craftcutstestapiproject20211120225609.azurewebsites.net/api/Barber")
            .then(
                (respon) => {
                    console.log(respon)
                    setBarber(respon.data)
                })
    }, []);*/

    const [service, setService] = useState([])
    useEffect(() => {
        axios
            .get("https://craftcutstestapiproject20211120225609.azurewebsites.net/api/Service")
            .then(
                (respon) => {
                    console.log(respon)
                    setService(respon.data)
                })
    }, []);

  let  submit = (event) => {
        let a = event.target.value;
      }
      

      const [serviceName, setServiceName] = React.useState('');
      localStorage.setItem("booking-info", serviceName);
    // var e = document.getElementById("option1");
    //   var strService = e.options[e.selectedIndex].text;
    //  console.log(strService);

    return (
        <div className={s.booking}>
            <div className={s.container}>
                <h1 className={s.h1Online}>Онлайн запись</h1>
                <h3 className={s.h3Choose}>Выберите необходимые варианты:</h3>
                <div className={s.container_choose}>

                    <form method="post">
                        <h4 className={s.h4choose}>Выберите мастера</h4>
                        <select onChange = {(e) => {const selectedmaster = e.target.value;
                        setServiceName(selectedmaster);}}>
                           
                        <option value="сережа" key="сережа">сережа</option>
                        <option value="глеб"  key="глеб">глеб</option>   
                        <option value="андрей"  key="андрей">андрей</option>
                       
                        </select>
                        
                        {serviceName}
                    </form><Link to={{ pathname: '/EndBooking',   state: {serviceName} }} className={s.btnbook}>Записаться</Link>
                </div>
                <div className={s.service}></div>
                <div className={s.time}></div>
            </div>
        </div>


    );


}
